// ==UserScript==
// @name         Replace Twitter Logo with Tux
// @namespace    http://tampermonkey.net/
// @version      1.1
// @description  Replaces the Twitter logo with a penguin image
// @author       umonaca, GPT
// @match        https://twitter.com/*
// @grant        none
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/472947/Replace%20Twitter%20Logo%20with%20Tux.user.js
// @updateURL https://update.greasyfork.org/scripts/472947/Replace%20Twitter%20Logo%20with%20Tux.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // TODO: Replace the penguinDataURL with the base64-encoded data URL of your penguin image
    const penguinDataURL = 'data:image/png;base64,'
    function replaceTwitterLogo() {
        const logoSvg = document.querySelector('a[href="/home"] > div > svg:not([replaced])');

        if (logoSvg) {
            const penguinImg = document.createElement('img');
            penguinImg.src = penguinDataURL;
            penguinImg.width = logoSvg.clientWidth*0.8;
            //penguinImg.height = logoSvg.clientHeight;
            penguinImg.height = penguinImg.width;
            //penguinImg.style.verticalAlign = 'middle';

            logoSvg.parentNode.replaceChild(penguinImg, logoSvg);
            //logoSvg.setAttribute('replaced', '');
        }
    }

    function initObserver() {
        const observer = new MutationObserver(replaceTwitterLogo);
        observer.observe(document.body, { childList: true, subtree: true });
    }

    if (document.readyState === 'loading') {
        window.addEventListener('DOMContentLoaded', initObserver);
    } else {
        initObserver();
    }
})();
